import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
     <h1>Sign up</h1>
     <div>
     <label>
        Username: <input name="myInput" />
      </label>
     </div>
    </div>
  );
}

export default App;
